    path: ../CoreRelm/Migrations/ModelSetResolver.cs
    startLine: 258
  assemblies:
  - CoreRelm
  namespace: CoreRelm.Migrations
  summary: >-
    Resolves a model set definition by name from the specified model sets file and returns the resolved set

    along with detailed diagnostics.
  remarks: >-
    The diagnostics object provides detailed information about the resolution process,
        such as missing types, attribute validation errors, and counts of included or excluded types. This method
        does not throw for missing or invalid attributes; instead, such issues are reported in the
        diagnostics.
  example: []
  syntax:
    content: public (ResolvedModelSet Resolved, ResolvedModelSetDiagnostics Diagnostics) ResolveSetWithDiagnostics(ModelSetsFile file, string setName)
    parameters:
    - id: file
      type: CoreRelm.Models.Migrations.ModelSetsFile
      description: The model sets file containing the definitions to resolve.
    - id: setName
      type: System.String
      description: The name of the model set to resolve. Must match a set defined in the provided file.
    return:
      type: System.ValueTuple{CoreRelm.Models.Migrations.ResolvedModelSet,CoreRelm.Models.Migrations.ResolvedModelSetDiagnostics}
      description: >-
        A tuple containing the resolved model set and a diagnostics object with information about the resolution
            process, including any errors or warnings encountered.
    content.vb: Public Function ResolveSetWithDiagnostics(file As ModelSetsFile, setName As String) As (Resolved As ResolvedModelSet, Diagnostics As ResolvedModelSetDiagnostics)
  overload: CoreRelm.Migrations.ModelSetResolver.ResolveSetWithDiagnostics*
  exceptions:
  - type: System.ArgumentException
    commentId: T:System.ArgumentException
    description: Thrown if a model set with the specified name does not exist in the provided file.
